import main.BeauAndersonFinalProject;

import java.beans.PropertyChangeListener;
import stringProcessors.HalloweenCommandProcessor;
import util.interactiveMethodInvocation.SimulationParametersControllerFactory;
import util.misc.ThreadSupport;
import util.trace.Tracer;
import util.trace.factories.FactoryTraceUtility;
import util.trace.misc.ThreadDelayed;
import util.trace.port.PerformanceExperimentEnded;
import util.trace.port.PerformanceExperimentStarted;
import util.trace.port.PortTraceUtility;
import util.trace.port.consensus.ConsensusTraceUtility;
import util.trace.port.nio.NIOTraceUtility;
import util.trace.port.rpc.rmi.RMITraceUtility;

public class Client extends AnAbstractSimulationParametersBean implements ClientInterface {

	ServerInterface server;
	HalloweenCommandProcessor cP1;
	protected int NUM_EXPERIMENT_COMMANDS = 500;
	public static final String EXPERIMENT_COMMAND_1 = "move 1 -1";
	public static final String EXPERIMENT_COMMAND_2 = "undo";
	protected PropertyChangeListener listener;
	
	
	public HalloweenCommandProcessor createSimulation(String aPrefix) {
		return 	BeauAndersonFinalProject.createSimulation(
					aPrefix,
					Simulation1.SIMULATION1_X_OFFSET, 
					Simulation.SIMULATION_Y_OFFSET, 
					Simulation.SIMULATION_WIDTH, 
					Simulation.SIMULATION_HEIGHT, 
					Simulation1.SIMULATION1_X_OFFSET, 
					Simulation.SIMULATION_Y_OFFSET);
	}
	
	public Client(ServerInterface server) {
		this.server = server;
	}

	@Override
	public void start(String[] args) throws RemoteException {
		// TODO Auto-generated method stub
		init(args);
		SimulationParametersControllerFactory.getSingleton().addSimulationParameterListener(this);
		SimulationParametersControllerFactory.getSingleton().processCommands();
		
	}

	@Override
	public void receiveBroadcast(String s) throws RemoteException {
		// TODO Auto-generated method stub
		util.misc.ThreadSupport.sleep(this.getDelay());
		util.trace.port.consensus.ProposalLearnedNotificationReceived.newCase(this, util.trace.port.consensus.communication.CommunicationStateNames.COMMAND,-1, s);
		util.trace.port.consensus.ProposedStateSet.newCase(this, util.trace.port.consensus.communication.CommunicationStateNames.COMMAND,-1, s);
		
	}
	
	public void quit() {
		System.exit(0);
	}
	
	
	/**
	 * Just printing some of the  client args needed for the RMI assignment by a client.
	 * In your client, you will need to use the printed client values in calls to
	 * the RMI API. In addition, in the server part, you will need to call
	 * ServerArgsProcessor instead to get the server args.
	 */
	void processArgs(String[] args) {	
		System.out.println("Registry host:" + ClientArgsProcessor.getRegistryHost(args));
		System.out.println("Registry port:" + ClientArgsProcessor.getRegistryPort(args));
		System.out.println("Server host:" + ClientArgsProcessor.getServerHost(args));
		System.out.println("Headless:" + ClientArgsProcessor.getHeadless(args));
		System.out.println("Client name:" + ClientArgsProcessor.getClientName(args));

		// Make sure you set this property when processing args
		System.setProperty("java.awt.headless", ClientArgsProcessor.getHeadless(args));
		
	}
	
	protected void setTracing() {
		PortTraceUtility.setTracing();
		RMITraceUtility.setTracing();
		NIOTraceUtility.setTracing();
		FactoryTraceUtility.setTracing();		
		ConsensusTraceUtility.setTracing();
		ThreadDelayed.enablePrint();
		trace(true);
	}
	
	
	protected void init (String[] args) {
		setTracing();
		processArgs(args);
		listener = new CouplerListener(ClientArgsProcessor.getClientName(args), server);
		cP1 = createSimulation(Simulation1.SIMULATION1_PREFIX);	
		cP1.addPropertyChangeListener(listener);
	}

	@Override	
	public void quit(int aCode) {
		System.exit(aCode);
	}	
	@Override

	public void simulationCommand(String aCommand) {
		long aDelay = getDelay(); 
		if (aDelay > 0) {
			ThreadSupport.sleep(aDelay);
		}
		cP1.setInputString(aCommand);
	}
	
	@Override	
	public void trace(boolean newValue) {
		super.trace(newValue);
		Tracer.showInfo(isTrace());
	}
	
	@Override
	public void localProcessingOnly(boolean newValue) {
		super.localProcessingOnly(newValue);
		if (isLocalProcessingOnly()) {
			cP1.removePropertyChangeListener(listener);
		} else {
			cP1.addPropertyChangeListener(listener);
		}
	}
	
	@Override
	public void atomicBroadcast(boolean newValue) {
		super.atomicBroadcast(newValue);
		cP1.setConnectedToSimulation(!isAtomicBroadcast());
	}
	
	@Override
	public void experimentInput() {
		long aStartTime = System.currentTimeMillis();
		PerformanceExperimentStarted.newCase(this, aStartTime, NUM_EXPERIMENT_COMMANDS);
		boolean anOldValue = isTrace();
		this.trace(false);
		for (int i = 0; i < NUM_EXPERIMENT_COMMANDS; i++) {
			cP1.setInputString(EXPERIMENT_COMMAND_1);
			cP1.setInputString(EXPERIMENT_COMMAND_2);
		}
		trace(anOldValue);
		long anEndTime = System.currentTimeMillis();
		PerformanceExperimentEnded.newCase(this, aStartTime, anEndTime, anEndTime - aStartTime, NUM_EXPERIMENT_COMMANDS);
		
	}
	
	@Override
	public void delaySends(int aMillisecondDelay) {
		super.delaySends(aMillisecondDelay);
	}	
}

package a4;

import java.io.Serializable;
import java.rmi.Remote;
import java.rmi.RemoteException;

public interface ServerInterface extends Remote, Serializable {

	public void startSim() throws RemoteException;
	public void setClients(ClientInterface client, String str) throws RemoteException;
	public void receiveBroadcast(String cli, String str) throws RemoteException;
}

package a4;

import java.rmi.RemoteException;

import java.util.HashMap;
import java.util.Map;

import assignments.util.inputParameters.AnAbstractSimulationParametersBean;
import util.interactiveMethodInvocation.SimulationParametersControllerFactory;

public class Server extends AnAbstractSimulationParametersBean implements ServerInterface {

	private Map<String, ClientInterface> clients  = new HashMap<>();
	//private int num = 0;
	
	@Override
	public void startSim() throws RemoteException {
		// TODO Auto-generated method stub
		SimulationParametersControllerFactory.getSingleton().addSimulationParameterListener(this);
		SimulationParametersControllerFactory.getSingleton().processCommands();
	}

	@Override
	public void setClients(ClientInterface cli, String str) throws RemoteException {
		// TODO Auto-generated method stub
		clients.put(str, cli);
		//num++;

	}

	@Override
	public void receiveBroadcast(String  cli, String str) throws RemoteException {
		util.trace.port.consensus.RemoteProposeRequestReceived.newCase(this, util.trace.port.consensus.communication.CommunicationStateNames.COMMAND, -1, str);
		
		for (String s : clients.keySet()) {
			if (s.equals(cli)) {
			} else {
				clients.get(s).broadcast(str);
			}
		}
		util.trace.port.consensus.ProposalLearnedNotificationSent.newCase(this, util.trace.port.consensus.communication.CommunicationStateNames.COMMAND,
				-1, str);
		
	}

	public void quit() {
		System.exit(0);
	}
}

